  return (

      <main className="content">
        <section className="e-invoice-graphic">
          {/* Placeholder for your graphic */}
        </section>
        <div className="homepage">
        <h1>Welcome!</h1>
        <span>"User's Name"</span>
        <a href="/" className="logout-button">Logout</a>
        <nav className="menu">
          <h2>Menu</h2>
          <ul>
            <li><button>Compose</button></li>
            <li><button>Inbox</button></li>
            <li><button>Sent</button></li>
          </ul>
        </nav>
        </div>
      </main>
  );
};

export default Homepage;
